const RightSidebarFirst = () => {
  return (
    <div className="w-1/4 p-6">
  <div className="flex flex-col items-start gap-2">
    <p className="text-4xl font-extrabold text-[#1b475d] leading-snug drop-shadow-sm">
      <span>UniWalls!</span>
      <span className="block text-base font-normal text-[#1b475d] italic"> 'a giriş yap</span>
    </p>

    <p className="text-2xl font-bold text-[#90beab] tracking-wide">kampüs</p>
    <p className="text-2xl font-bold text-[#1b475d] tracking-wider">hayatını</p>
    <p className="text-2xl font-bold text-[#ff7c5c]  tracking-widest">dijitalde</p>
    <p className="text-2xl font-bold text-[#90beab] tracking-wide">yaşa</p>
  </div>
</div>
  );
};

export default RightSidebarFirst;
